import { Shirt } from 'generated';
import { ItemProp } from './ItemProp';

type Props = {
  shirt: Shirt;
};

export const ShirtItem: React.FunctionComponent<Props> = ({ shirt }: Props) => {
  return (
    <>
      <ItemProp label="Color">{shirt.color}</ItemProp>
      <ItemProp label="Size">{shirt.size}</ItemProp>
    </>
  );
};
